Config.db_i18n [17162]  = {zh-cn= [[【{1500,谢谢你帮我收集雪球，告诉你个秘密哦，这片雪域有两位领主，守护着两件神器，一件可将雪域变成炎狱，一件可将天空变成深渊。},{1208,大人，我听说过其中一件，名叫燃烬，相传藏在极寒之地却永远在燃烧,无尽的法力带来无尽的诱惑，趋之若鹜的莽夫如同飞蛾扑火，自取毁灭。}】]] , zh-hk= [[【{1500,謝謝你幫我收集雪球，告訴你個秘密哦，這片雪域有兩位領主，守護著兩件神器，一件可將雪域變成炎獄，一件可將天空變成深淵。},{1208,大人，我聽說過其中一件，名叫燃燼，相傳藏在極寒之地卻永遠在燃燒,無盡的法力帶來無盡的誘惑，趨之若鶩的莽夫如同飛蛾撲火，自取毀滅。}】]] , thai= [[]] , en= [[【{1500, Thank you for these snowballs. I'll tell you something - there are two princesses here, and respectively they guard two pieces of artifacts - one turns the snowland into burning hell and the other makes the azure sky the dark abyss. },{1208, Master, I once heard about one of the artifacts, it's called the Cinderflame - its permanent flame in the everfrozen zone tempts the ones pursue such immortal power, and they were all turned into ashes by it.}】]] }
