Config.db_i18n [17234]  = {zh-cn= [[【总不枉我做狗仔的这些天，听说巅峰转生的秘密藏在海底圣殿，大人在神殿觅得的宝贝记得关照小商！】]] , zh-hk= [[【總不枉我做狗仔的這些天，聽說巔峰轉生的秘密藏在海底聖殿，大人在神殿覓得的寶貝記得關照小商！】]] , thai= [[]] , en= [[【I didn't waste these days when I am a paparazzi. I heard that the secret of the peak incarnation is hidden in the temple at the bottom of the sea. For the treasures that you find in the temple, I'll give out my best price!】]] }
