Config.db_i18n [17237]  = {zh-cn= [[【形形色色的人都来探索圣殿，前面那个圆圆的家伙，是你们人类的厨师么？啊我仿佛已经闻到了烤鱼的香味……】]] , zh-hk= [[【形形色色的人都來探索聖殿，前面那個圓圓的傢伙，是你們人類的廚師麼？啊我仿佛已經聞到了烤魚的香味……】]] , thai= [[]] , en= [[【All kinds of people come to explore the temple. Is the fat guy in front of you a human chef? Ah, I can smell the fragrance of roasted fish...】]] }
