Config.db_i18n [17316]  = {zh-cn= [[【{时间就是金钱，我的朋友！},{我从前也是个冒险家，直到我膝盖中了一剑},{我就是神！我就是命运！},{我如战士一般活着，如神一般逝去},{那边哪位高富帅，我有个不错的点子，要不要听听},{被我的美丽迷住了？ 难道美丽也是一种错误？ 哦~~~欢迎欢迎 ，勇士下次再来哦， 愿你得到维娜斯的恩宠 ，除了不存在的其他的都有哦。 },{与高手对决时，所谓武器， 你要找什么？ 你来这干嘛？ 你可以走了，鲜血四溅的感觉让我兴奋要时刻保持警惕。},{欢迎你，你的委托我们会尽快处理，欢迎来到淘金圣地，如果需要什么请跟我说，慢走，买卖绝对公平合理 。},{祝你发大财，选一个看看吧来以钱赚钱啦。 嘿嘿。},{啊~肩膀有点酸。。。能不能。帮我揉揉？},{如果你是为领悟真理而来。我非常欢迎。}】]] , zh-hk= [[【{時間就是金錢，我的朋友！},{我從前也是個冒險家，直到我膝蓋中了一劍},{我就是神！我就是命運！},{我如戰士一般活著，如神一般逝去},{那邊哪位高富帥，我有個不錯的點子，要不要聽聽},{被我的美麗迷住了？ 難道美麗也是一種錯誤？ 哦~~~歡迎歡迎 ，勇士下次再來哦， 願你得到維娜斯的恩寵 ，除了不存在的其他的都有哦。 },{與高手對決時，所謂武器， 你要找什麼？ 你來這幹嘛？ 你可以走了，鮮血四濺的感覺讓我興奮要時刻保持警惕。},{歡迎你，你的委託我們會儘快處理，歡迎來到淘金聖地，如果需要什麼請跟我說，慢走，買賣絕對公平合理 。},{祝你發大財，選一個看看吧來以錢賺錢啦。 嘿嘿。},{啊~肩膀有點酸。。。能不能。幫我揉揉？},{如果你是為領悟真理而來。我非常歡迎。}】]] , thai= [[]] , en= [[【{Time is money, my friend!} {I used to be an adventurer like you, then I took an arrow in the knee.}, {I am the living god! I am destiny! },{I live like a warrior and fade away like a god.}, {Hey, I got something for you, handsome guy.}, {Are you obsessed by my face? Hope my beauty didn't get me wrong! Oops, welcome, champion! Don't forget to come back next time, may Venus be with you! },{What are you looking for? A weapon for the duel? Why are you here? You may go now, I shall stay vigilant. },{Welcome, we'll handle your request ASAP. Tell me if you need something. },{May luck be with you, my friend! Haha. },{Ah, my shoulder sores. Could you... Help me relieve the pain? },{If you came for the truth. I shall show you my warmest welcome.】]] }
